    Team:"Neutral",
    Content:"\"They heard, and were abashed, and up they sprung\r\nUpon the wing, as when men wont to watch\r\nOn duty, sleeping found by whom they dread,\r\nRouse and bestir themselves ere well awake.\r\nNor did they not perceive the evil plight\r\nIn which they were, or the fierce pains not feel;\r\nYet to their generals voice they soon obeyed\r\nInnumerable. As when the potent rod\r\nOf Amrams son in Egypts evil day\r\nWaved round the coast, up called a pitchy cloud\r\nOf locusts, warping on the eastern wind,\r\nThat ore the realm of impious Pharaoh hung\r\nLike night, and darkened all the land of Nile:\r\nSo numberless were those bad angels seen\r\nHovering on wing under the cope of Hell\r\nedwixt upper, nether, and surrounding fires\" (1.331-346) [negative]; \"Peor his other name, when he enticed\r\nIsrael in Sittim on their march from Nile\r\nTo do him wanton rites, which cost them woe.\" (1.412-414) [neutral]; \"In a dark age, against example good,\r\nAgainst allurement, custom, and a world\r\nOffended: fearless of reproach and scorn,\r\nThe grand-child, with twelve sons increased, departs\r\nFrom Canaan, to a land hereafter called\r\nEgypt, divided by the river Nile;\r\nSee where it flows, disgorging at seven mouths\r\nInto the sea\" (11.809-11.816) [neutral]; \" This patriarch blest,\r\nWhom faithful Abraham due time shall call,\r\nA son, and of his son a grand-child, leaves;\r\nLike him in faith, in wisdom, and renown:\r\nThe grandchild, with twelve sons increased, departs\r\nFrom Canaan to a land hereafter called\r\nEgypt, divided by the river Nile\r\nSee where it flows, disgorging at seven mouths\r\nInto the sea.\" (12.151-159) [neutral]",
