    Content:"\"The aggregated soil \r\nDeath with his mace petrific, cold and dry, \r\nAs with a trident, smote; and fixed as firm \r\nAs Delos, floating once; the rest his look \r\nBound with Gorgonian rigor not to move; \r\nAnd with asphaltic slime, broad as the gate, \r\nDeep to the roots of Hell the gathered beach \r\nThey fastened, and the mole immense wrought on \r\nOver the foaming deep high-arched, a bridge \r\nOf length prodigious, joining to the wall \r\nImmoveable of this now fenceless world, \r\nForfeit to Death; from hence a passage broad, \r\nSmooth, easy, inoffensive, down to Hell.\" (10.293-305) [negative] / \"As when by night the glass \r\nOf Galileo, less assured, observes \r\nImagined lands and regions in the moon: \r\nOr pilot, from amidst the Cyclades \r\nDelos or Samos first appearing, kens \r\nA cloudy spot. Down thither prone in flight \r\nHe [Raphael] speeds, and through the vast ethereal sky \r\nSails between worlds and worlds, with steady wing \r\nNow on the polar winds, then with quick fan \r\nWinnows the buxom air; till, within soar \r\nOf towering eagles, to all the fowls he seems \r\nA phoenix, gazed by all as that sole bird, \r\nWhen, to enshrine his relics in the sun's \r\nBright temple, to Egyptian Thebes he flies.\" (5.261-274) [neutral]",
