    Team:"Positive",
    Content:"\"Of mans first disobedience, and the fruit \r\nOf that forbidden tree, whose mortal taste \r\nBrought death into the world, and all our woe, \r\nWith loss of Eden, till one greater man \r\nRestore us, and regain the blissful seat, \r\nSing heavenly muse, that on the secret top \r\nOf Oreb, or of Sinai, didst inspire \r\nThat shepherd, who first taught the chosen seed, \r\nIn the beginning how the heavens and earth \r\nRose out of chaos: Or if Sion hill \r\nDelight thee more, and Siloa's brook that flowed \r\nFast by the oracle of God\" (1.1-12) [positive]/ \"Say, Muse, their names then known, who first, who last, \r\nRoused from the slumber, on that fiery couch, \r\nAt their great emperors call, as next in worth \r\nCame singly where he stood on the bare strand, \r\nWhile the promiscuous crowd stood yet aloof? \r\nThe chief were those who from the pit of Hell \r\nRoaming to seek their prey on Earth, durst fix \r\nTheir seats long after next the seat of God, \r\nTheir altars by his altar, gods adored \r\nAmong the nations round, and durst abide \r\nJehovah thundering out of Sion, throned \r\nBetween the cherubim; yea, often placed \r\nWithin his sanctuary it self their shrines, \r\nAbominations; and with cursed things \r\nHis holy rites, and solemn feasts profaned,] \r\nAnd with their darkness durst affront his light.\" (1.376-391) [positive] / \"Yet not the more \r\nCease I to wander, where the Muses haunt, \r\nClear spring, or shady grove, or sunny hill, \r\nSmit with the love of sacred song; but chief \r\nThee, Sion, and the flowery brooks beneath, \r\nThat wash thy hallowed feet, and warbling flow, \r\nNightly I visit: nor sometimes forget \r\nSo were I equaled with them in renown, \r\nThy sovereign command, that man should find grace; \r\nBlind Thamyris, and blind Maeonides, \r\nAnd Tiresias, and Phineus, prophets old: \r\nThen feed on thoughts, that voluntary move \r\nHarmonious numbers; as the wakeful bird \r\nSings darkling, and in shadiest covert hid \r\nTunes her nocturnal note.\" (3.26-40) [positive] / \"The stairs were then let down, whether to dare \r\nThe Fiend by easy ascent, or aggravate \r\nHis sad exclusion from the doors of bliss: \r\nDirect against which opened from beneath, \r\nJust o'er the blissful seat of Paradise, \r\nA passage down to the Earth, a passage wide, \r\nWider by far than that of after-times \r\nOver mount Sion, and, though that were large, \r\nOver the Promised Land to God so dear; \r\nBy which, to visit oft those happy tribes, \r\nOn high behests his angels to and fro \r\nPassed frequent, and his eye with choice regard \r\nFrom Paneas, the fount of Jordan's flood, \r\nTo Beersaba, where the Holy Land \r\nBorders on Egypt and the Arabian shore; \r\nSo wide the opening seemed, where bounds were set \r\nTo darkness, such as bound the ocean wave.\" (3.523-539) [positive]",
