    Content:"\"So thick the aerie crowd \r\nSwarmed and were straitened; till the signal given. \r\nBehold a wonder! they but now who seemed \r\nIn bigness to surpass Earths giant sons \r\nNow less then smallest dwarfs, in narrow room \r\nThrong numberless, like that Pigmean race \r\nBeyond the Indian mount, or fairy elves, \r\nWhose midnight revels, by a forest side \r\nOr fountain some belated peasant sees, \r\nOr dreams he sees, while overhead the moon \r\nSits arbitress, and nearer to the Earth \r\nWheels her pale course, they on their mirth and dance \r\nIntent, with jocund music charm his ear; \r\nAt once with joy and fear his heart rebounds.\" (1.775-788) [neutral] / \"Bestirs her then, and from each tender stalk \r\nWhatever Earth, all-bearing mother, yields \r\nIn India East or West, or middle shore \r\nIn Pontus or the Punick coast, or where \r\nAlcinous reigned, fruit of all kinds, in coat \r\nRough, or smooth rind, or bearded husk, or shell, \r\nShe [Eve] gathers, tribute large, and on the board \r\nHeaps with unsparing hand\" (4.337-344) [postive] / \"Here walked the Fiend at large in spacious field. \r\nAs when a vulture on Imaus bred, \r\nWhose snowy ridge the roving Tartar bounds, \r\nDislodging from a region scarce of prey \r\nTo gorge the flesh of lambs or yeanling kids, \r\nOn hills where flocks are fed, flies toward the springs \r\nOf Ganges or Hydaspes, Indian streams; \r\nBut in his way lights on the barren plains \r\nOf Sericana, where Chineses drive \r\nWith sails and wind their cany wagons light: \r\nSo, on this windy sea of land, the Fiend \r\nWalked up and down alone, bent on his prey\" (3.430-441) [neutral] / \"So counseled he [Adam], and both [with Eve] together went \r\nInto the thickest wood; there soon they chose \r\nThe fig-tree; not that kind for fruit renowned, \r\nBut such as at this day, to Indians known, \r\nIn Malabar or Decan spreads her arms \r\nBranching so broad and long, that in the ground \r\nThe bended twigs take root, and daughters grow \r\nAbout the mother tree, a pillared shade \r\nHigh over-arched, and echoing walks between: \r\nThere oft the Indian herdsman, shunning heat, \r\nShelters in cool, and tends his pasturing herds \r\nAt loop-holes cut through thickest shade: Those leaves \r\nThey gathered, broad as Amazonian targe; \r\nAnd, with what skill they had, together sewed, \r\nTo gird their waist; vain covering, if to hide \r\nTheir guilt and dreaded shame.\" (9.1099-1114) [neutral]",
    Comments:"Fertile land associated with fruitfulness of Paradise. / River with a source in the Himalayas, passed by Satan en route to Eden. / Habitat of fig-tree, whose leaves Adam and Eve used to cover their nakedness after the eating the fruit.",
