    Weight:"3",
    Team:"Negative",
    Content:"\"So spake the enemy of mankind, enclosed \r\nIn serpent, inmate bad, and toward Eve \r\nAddressed his way: not with indented wave, \r\nProne on the ground, as since; but on his rear, \r\nCircular base of rising folds, that towered \r\nFold above fold, a surging maze, his head \r\nCrested aloft, and carbuncle his eyes; \r\nWith burnished neck of verdant gold, erect \r\nAmidst his circling spires, that on the grass \r\nFloated redundant: pleasing was his shape \r\nAnd lovely; never since of serpent-kind \r\nLovelier, not those that in Illyria changed, \r\nHermione and Cadmus, or the god \r\nIn Epidaurus; nor to which transformed \r\nAmmonian Jove, or Capitoline, was seen; \r\nHe with Olympias; this with her who bore \r\nScipio, the heighth of Rome.\" (9.494-510) [neutral] / \"She scarce had said, though brief, when now more bold \r\nThe Tempter, but with show of zeal and love \r\nTo Man, and indignation at his wrong, \r\nNew part puts on; and, as to passion moved, \r\nFluctuates disturbed, yet comely and in act \r\nRaised, as of some great matter to begin. \r\nAs when of old some orator renowned, \r\nIn Athens or free Rome, where eloquence \r\nFlourished, since mute, to some great cause addressed, \r\nStood in himself collected; while each part, \r\nMotion, each act, won audience ere the tongue; \r\nSometimes in heighth began, as no delay \r\nOf preface brooking, through his zeal of right: \r\nSo standing, moving, or to heighth up grown, \r\nThe Tempter, all impassioned, thus began.\" (9.664-678) [negative]/ \"To whom thus Adam gratefully replied. \r\nAscend, I follow thee, safe Guide, the path \r\nThou leadest me; and to the hand of Heaven submit, \r\nHowever chastening; to the evil turn \r\nMy obvious breast; arming to overcome \r\nBy suffering, and earn rest from labor won, \r\nIf so I may attain. So both ascend \r\nIn the visions of God. It was a hill, \r\nOf Paradise the highest; from whose top \r\nThe hemisphere of earth, in clearest ken, \r\nStretched out to the amplest reach of prospect lay. \r\nNot higher that hill, nor wider looking round, \r\nWhereon, for different cause, the Tempter set \r\nOur second Adam, in the wilderness; \r\nTo show him all Earth's kingdoms, and their glory. \r\nHis eye might there command wherever stood \r\nCity of old or modern fame, the seat \r\nOf mightiest empire, from the destined walls \r\nOf Cambalu, seat of Cathaian Can, \r\nAnd Samarchand by Oxus, Temir's throne, \r\nTo Paquin of Sinaean kings; and thence \r\nTo Agra and Lahor of great Mogul, \r\nDown to the golden Chersonese; or where \r\nThe Persian in Ecbatan sat, or since \r\nIn Hispahan; or where the Russian Czar \r\nIn Moscow; or the Sultan in Bizance, \r\nTurkestan-born; nor could his eye not ken \r\nThe empire of Negus to his utmost port \r\nErcoco, and the less maritime kings \r\nMombaza, and Quiloa, and Melind, \r\nAnd Sofala, thought Ophir, to the realm \r\nOf Congo, and Angola farthest south; \r\nOr thence from Niger flood to Atlas mount \r\nThe kingdoms of Almansor, Fez and Sus, \r\nMorocco, and Algiers, and Tremisen; \r\nOn Europe thence, and where Rome was to sway \r\nThe world: in spirit perhaps he also saw \r\nRich Mexico, the seat of Montezuma, \r\nAnd Cusco in Peru, the richer seat \r\nOf Atabalipa; and yet unspoiled \r\nGuiana, whose great city Geryon's sons \r\nCall El Dorado.\" (11.370-411) [negative]",
